import React from 'react';
import { Card, CardBody, CardTitle, CardText, CardImg, CardSubtitle } from 'reactstrap';
function CharacterCardCreator(props){
    console.log(props);
    const {image, name, species, gender, location, origin} = props;
    return(

        <Card className="mb-3" style={{"maxWidth": "300px"}}>
          <div class="row no-gutters">
            <div class="col-md-4">
              <img src={image} class="card-img" alt="..."/>
            </div>
            <div class="col-md-8">
              <div class="card-body">
                <h5 class="card-title">{name}</h5>
                <p class="card-text">{`${species}, ${gender}`}</p>
                <p class="card-text">{`${location}, ${origin}`}</p>
              </div>
            </div>
          </div>
        </Card>
    )
}

export default CharacterCardCreator;
